  input: TEXT,F3XA,,"This report reflects the modifications requested by the FEC in
    the letter dated 10/18/2006, after helpful consultation with FEC staff. The Executive
    Director (ED) of the committee serves in a primarily administrative capacity,
    and did not engage in Federal Election Activity more than 25% of the time. The
    ED completes, and the committee maintains on file, a signed statement on a monthly
    basis that certifies the percentage of time spent on FEA. At no time in 2006 did
    the percentage of time spent on FEA exceed 25%. Itemized disbursements have been
    updated with the requested descriptions clarified. The items classified as 'exempt'
    (due to an error in the manner in which the filing software was used) have been
    re-classified as administrative expenses, with the proper adjustments to the federal
    and non-federal allocations. The reimbursements on Sch. H4 have been adjusted
    to show both the individual reimbursed and a memo item detailing the information
    on the original vendors. There was a significant delay in making these changes
    as the original letter from the FEC was apparently lost, and only by chance was
    the letter discovered in early 2007 on the FEC web site."
